// CategoryList.js
import React from 'react';
import CategoryTitle from './CategoryTitle';

function CategoryListLeft({ categories }) {
    return (
        <div>
            {categories.map((title, index) => (
                <CategoryTitle key={`category-${index}`} title={title} border={title === "주간 인기 책"} />
            ))}
        </div>
    );
}

export default CategoryListLeft;
